import React, { Component } from 'react';
import {useNavigate, useNavigation} from 'react-router-dom';

export default function HeaderComponent(){
    const navigate = useNavigation();




    render() 
        return (
            <div>

                <header>
                    <nav className="navbar  navbar-expand-md navbar-dark bg-dark">
                        <div><a href = "www.google.com" className="navbar-brand"><h2>D'VILLA</h2></a></div>

                        <nav className="navbar  navbar-expand-lg navbar-dark bg-dark justify-content-left">
                        <div className="btn-group" role="group" aria-label="Basic outlined example">
                            <li><button type="button" class="btn btn-outline-primary" onClick={() => {navigate("/add-employee")}}>Add Employee</button></li>
                            <li><button type="button" class="btn btn-outline-primary">View Employee Details</button></li>
                            <li><button type="button" class="btn btn-outline-primary">Print Report</button></li>

                        </div>
                        </nav>
                    </nav>

                </header>
            </div>
        );

}
